import { Route, Routes } from 'react-router-dom';
import { CalculatorForm } from './components/CalculatorForm'; // Import your form component
import ResultPage from './Pages/ResultPage'; // Import your result page component
import Home from './Pages/HomePage'; // Import Home page component

function App() {
  return (
    <div>
      <Routes>
        {/* Home Page with CalculatorForm */}
        <Route path="/" element={<Home />} />

        {/* Result Page */}
        <Route path="/result" element={<ResultPage />} />

        {/* If you want to render CalculatorForm on a specific route */}
        <Route path="/calculator" element={<CalculatorForm />} />
      </Routes>
    </div>
  );
}

export default App;
